import React from "react";
import TimelineHeader from "../../components/TimelineHeader/TimelineHeader";
import { PrincipalPage } from '../../layout/principalPage';
import { Intro } from '../../components/Intro/intro';
import { CreatePost } from '../../components/CreatePost/CreatePost';
import { MainPost } from "../../components/MainPost/MainPost";
import { Posts } from "../../components/CreatePost/Posts";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";


export function UserProfile() {
  return (

      <PrincipalPage>
        <TimelineHeader />
        <div className="grid grid-cols-1 md:grid-cols-11 pt-4 gap-4 z-0 pb-56">
          <div className="col-span-1 md:col-span-3 space-y-4">
            <Intro />
          </div>
          <div className="col-span-1 md:col-span-8 space-y-4">

            <Routes>
            <Route path="/posts" element={
              <MainPost />} />
              <Route path="/connections" element={<p>Connections Page</p>} />
              <Route path="/views" element={<p>Views Page</p>} />
              <Route path="/" element={<>
                <CreatePost />
                <MainPost />
              </>} />
            </Routes>

          </div>
        </div>
      </PrincipalPage>

  );
}
